(631, '61e3335593f86a0cd9e237fe4353ec9c', 3, '542265', 275, 277, '近愛河畔優質公寓+頂樓套房', '高雄市前金區長生街', 2, '2;2;2;', 29.9748, 0, 30, '', 3, '', 0, '', 16.61, 498, '近愛河畔.雄女.大建坪公寓+頂樓套房\r\n一、自住.投資:5樓(29.97坪:2房2廳2衛)+頂樓套房 (1房1衛浴、室內使用約8坪)，屋主自建保留戶、稀有釋出，頂樓大露台剛完成防水精緻工程(好運用:可規劃空中花園、曬衣物….)，三面採光明亮、通風良好。\r\n二、商圈、學區:位前金精華區、近新崛江商圈；臨高雄女中、近前金國小、新興國中等學區。\r\n三、生活機能優:近大立百貨公司、傳統市場、郵局、銀行、市立大同醫院、圖書館、前金區公所、各行業及商店林立，食衣住行育樂等非常便利。\r\n四、交通便利:近五福路、中正路、中央公園捷運站、市公車等，交通非常便利。\r\n五、觀光運動休閒便利:近愛河、中央公園、學校等場所。\r\n', '2;5;15;', 4, '', 0, '2019-05-20 23:08:24', '2019-05-20 15:08:24', 0),
